import React from 'react';
import styled from 'styled-components';

const Button = styled.button`
  cursor: pointer;
  background: transparent;
  font-size: 16px;
  border-radius: 3px;
  color: palevioletred;
  border: 2px solid palevioletred;
  margin: 0 1em;
  padding: 0.25em 1em;
  transition: 0.5s all ease-out;

  &:hover {
    background-color: palevioletred;
    color: white;
  }
`;


const FooterMenu = (props) => {
    return (
      <section className="footerMenu">
          <a className="menuItem" href="terms-and-conditions.html">Terms &
              Conditions</a>
          <a className="menuItem" href="privacy-policy.html">Privacy</a>
          <a className="menuItem" target="_blank" rel="noopener noreferrer" href="https://dexwallet.freshdesk.com/">Support</a>
          <a className="menuItem" href="mailto:founders@dexlab.io">Business Inquiries</a>
          <Button>suca</Button>
      </section>

        );
  }

  export default FooterMenu;
